import React, { Component } from 'react'
import './Quiz.css'

class Quiz extends Component {
  state = {
    quiz: []
  }
  render() {
    return(
      <div className="Quiz">
        <h1>Quiz</h1>
      </div>
    )
  }
}

export default Quiz
